import React from "react";
import "./style.css";

function Footer() {
  return (
    <footer className="footer">
      <span><div class="container"><p class="footer-social"><a href="//www.facebook.com/" target="_blank"></a></p></div></span>
    </footer>
  );
}

export default Footer;
